 import React, {useContext, useEffect} from 'react';
 import taskContext from '../context/tasks/taskContext';

export const About = () => {
    const a = useContext(taskContext)
    useEffect(()=>{
        a.update()
    },[])
    return (
        <div>
            This is About {a.state.name} and he is in class {a.class}
        </div>
    )
}

export default About;
